class Product {
    constructor(productId, name, description, price, baseprice, image, categoryId) {
      this.productId = productId;
      this.name = name;
      this.description = description;
      this.price = price;
      this.baseprice = baseprice;
      this.image = image;
      this.categoryId = categoryId;
    }
  }
  
  export default Product;